            <Layout>
                <Header>
                    <h1 style={{ border: 'solid 2px #298CCE',width:'1000px',height:'150px',marginTop:'50px' }}></h1>
                </Header>
                <Content>

                </Content>
            </Layout>
        )
    }
}
